import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      <div className="logo-container">
        <img src="/assets/college-logo.png" alt="College Logo" className="college-logo" />
        <h1>College Name</h1>
      </div>
      <p className="welcome-text">Welcome to College Chronicle</p>
    </div>
  );
};

export default Home;
